import { useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import { Container, Row, Col, Button, Input, Navbar, NavbarBrand, Nav, NavItem, NavLink, FormGroup, Label, Form } from "reactstrap";

const Home = () => {
  const email = useSelector((state) => state.users.user.email);
  const navigate = useNavigate();

  // Local state for form inputs
  const [salary, setSalary] = useState("");
  const [electricity, setElectricity] = useState("");
  const [water, setWater] = useState("");
  const [household, setHousehold] = useState("");
  const [personal, setPersonal] = useState("");

 /* useEffect(() => {
    if (!email) {
      navigate("/login");
    } else {
      navigate("/home");
    }
  }, [email, navigate]);
*/
  const handleSave = (e) => {
    e.preventDefault();
    const totalExpenses = Number(electricity) + Number(water) + Number(household) + Number(personal);
    const remaining = Number(salary) - totalExpenses;
    alert(`✅ Total Expenses: $${totalExpenses.toFixed(2)}\n💰 Remaining Salary: $${remaining.toFixed(2)}`);
  };

  const handleLike = () => {
    alert("You liked this form! ❤️");
  };

  return (
    <>
      {/* 🔥 Navbar */}
      <Navbar color="dark" dark expand="md">
        <NavbarBrand href="/">Home Budget App</NavbarBrand>
        <Nav className="ml-auto" navbar>
          <NavItem>
            <NavLink href="#profile">Profile</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#location">Location</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#update-profile">Update Profile</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#feedback">Feedback</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#logout">Logout</NavLink>
          </NavItem>
        </Nav>
      </Navbar>

      {/* 🚀 Main Content */}
      <Container className="mt-5">
        <Row>
          <Col md={{ size: 8, offset: 2 }}>
            <h2 className="text-center mb-4">Monthly Budget Form</h2>
            <Form onSubmit={handleSave}>
              <FormGroup>
                <Label for="salary">Monthly Salary</Label>
                <Input
                  type="number"
                  id="salary"
                  value={salary}
                  onChange={(e) => setSalary(e.target.value)}
                  required
                />
              </FormGroup>

              <FormGroup>
                <Label for="electricity">Electricity Bill</Label>
                <Input
                  type="number"
                  id="electricity"
                  value={electricity}
                  onChange={(e) => setElectricity(e.target.value)}
                  required
                />
              </FormGroup>

              <FormGroup>
                <Label for="water">Water Bill</Label>
                <Input
                  type="number"
                  id="water"
                  value={water}
                  onChange={(e) => setWater(e.target.value)}
                  required
                />
              </FormGroup>

              <FormGroup>
                <Label for="household">Household Expenses</Label>
                <Input
                  type="number"
                  id="household"
                  value={household}
                  onChange={(e) => setHousehold(e.target.value)}
                  required
                />
              </FormGroup>

              <FormGroup>
                <Label for="personal">Personal Use</Label>
                <Input
                  type="number"
                  id="personal"
                  value={personal}
                  onChange={(e) => setPersonal(e.target.value)}
                  required
                />
              </FormGroup>

              <Row>
                <Col md={6}>
                  <Button color="success" type="submit" block>
                    Save
                  </Button>
                </Col>
                <Col md={6}>
                  <Button color="danger" type="button" block onClick={handleLike}>
                    ❤️ Like
                  </Button>
                </Col>
              </Row>
            </Form>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default Home;
